  })
    .then((res) => {
      console.log(res);
    })
    .catch((error) => {
      console.log(error);
    });

  return (
    <div>
      <Menu_nav_text name={"랭킹"}></Menu_nav_text>
    </div>
  );
}

export default Rank_main;
